import React from 'react'
import { Card, Button, Table, Space } from 'antd'
const Manager = () => {
    const dataSource = [
        {
            key: '1',
            name: '汪红光',
            sid: 2702170119,
            creatTime: '2020-8-15 19:00',
        }
    ];

    const columns = [
        {
            title: '姓名',
            dataIndex: 'name',
            key: 'name',
        },
        {
            title: '学号',
            dataIndex: 'sid',
            key: 'sid',
        },
        {
            title: '提交时间',
            dataIndex: 'creatTime',
            key: 'creatTime',
        },
        {
            title: '操作',
            dataIndex: 'action',
            key: 'action',
            render: (text,record) => {
                return <Space size="middle">
                    <a onClick={()=>deleteData()}>删除</a>
                    <a>导出</a>
